// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;

import "./StorageSurveys.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC777/IERC777.sol";
import "@openzeppelin/contracts/token/ERC777/IERC777Recipient.sol";
import "@openzeppelin/contracts/token/ERC777/IERC777Sender.sol";

contract ProxySurveys is StorageSurveys, Ownable
{
  address currentAddress;
  
  IERC777 private _token;

  constructor(address _currentAddress, IERC777 token) public
  {
    currentAddress = _currentAddress;
    _token = token;
  }

  function update(address _newAddress) onlyOwner public
  {
    currentAddress = _newAddress;
  }

  //FALLBACK function
  fallback() payable external
  {
    //Redirect to currentAddress
    address implementation = currentAddress;
    require(currentAddress != address(0));
    bytes memory data = msg.data;

    assembly
    {
      let result := delegatecall(gas(), implementation, add(data, 0x20), mload(data), 0, 0)
      let size := returndatasize()
      let ptr := mload(0x40)
      returndatacopy(ptr, 0, size)
      switch result
      case 0 {revert(ptr, size)}
      default {return(ptr, size)}
    }
  }
}
